\[
\text{time} = \frac{\text{distance}}{\text{speed}}
\]

Substituting the values for the slow-car:

\[
\text{time} = \frac{480}{30} = 16 \text{ hours}
\]

Thus, the time taken by the car in the slow lane to cover 480 miles is 16.

